import React, {Component} from "react";

const PinForm = () => {
    const [statePin, setStatePin] = useState(
        {
            name: "",
            categoryType: "",
            lat: 0.0,
            lng: 0.0,
            notes: "",
            user: "",
            id: 0
        }
    )
}

export default PinForm;
